import React from "react";

const NestedModal = ({ isOpen, onClose, children }) => {
    if (!isOpen) return null;

    return (
        <div className="nested_modal">
            <div className="nested_modal_content">
                { children }
                <button onClick={onClose}>Cerra</button>
            </div>
        </div>
    )
}  

export default NestedModal;
